test_requests_mixin = RequestsMixin()
httpretty.register_uri(httpretty.GET, 'http://test__get_data/', body=
    '[{"test": "true"}]', adding_headers={'X-session-cookie': 'abcd1234'})
test_requests_mixin._get_data('http://test__get_data/').should.equal([{
    'test': 'true'}])
httpretty.register_uri(httpretty.GET, 'http://test__post_data_500/', status=500
    )
test_requests_mixin._get_data.when.called_with('http://test__post_data_500/'
    ).should.throw(InternalServerError)
httpretty.register_uri(httpretty.GET, 'http://test__post_data_404/', status=404
    )
test_requests_mixin._get_data.when.called_with('http://test__post_data_404/'
    ).should.throw(ResourceNotFoundError)
httpretty.register_uri(httpretty.GET, 'http://test__post_data_403/', status=403
    )
test_requests_mixin._get_data.when.called_with('http://test__post_data_403/'
    ).should.throw(AuthenticationError)
httpretty.activate
